CREATE TABLE `result` (
  `res_id` int NOT NULL AUTO_INCREMENT,
  `sid` int DEFAULT NULL,
  `sub_id` int DEFAULT NULL,
  `exam_type_id` int DEFAULT NULL,
  `currdate` datetime DEFAULT CURRENT_TIMESTAMP,
  `att` char(1) DEFAULT 'p',
  `obtained_mark` int DEFAULT NULL,
  PRIMARY KEY (`res_id`),
  UNIQUE KEY `sub_id` (`sub_id`,`exam_type_id`,`sid`,`currdate`),
  KEY `sid` (`sid`),
  KEY `exam_type_id` (`exam_type_id`),
  CONSTRAINT `result_ibfk_1` FOREIGN KEY (`sid`) REFERENCES `student` (`sid`),
  CONSTRAINT `result_ibfk_2` FOREIGN KEY (`sub_id`) REFERENCES `subject_master` (`sub_id`),
  CONSTRAINT `result_ibfk_3` FOREIGN KEY (`exam_type_id`) REFERENCES `exam_type_master` (`exam_type_id`),
  CONSTRAINT `result_chk_1` CHECK ((`att` in (_utf8mb4'p',_utf8mb4'a',_utf8mb4'o'))),
